import { useState } from "react";
import HomePage from "./HomePage";
import ResultsPage from "./ResultsPage";

function App() {
  const [homePage, setHomePage] = useState(true);

  return (
    <div className="App">
      {homePage ? (
        <HomePage searchButton={setHomePage} homePage={homePage} />
      ) : (
        <ResultsPage />
      )}
    </div>
  );
}
export default App;
